import React from 'react'
import {TextField} from "@material-ui/core";

function MakePost(props) {
    const {signInPopUp, signOutCool, currentUser, addPost} = props;
    return (
        <div>
            {!currentUser && <div className="notSignedIn">
                <h1>Please sign in if you want to make a post to Bear Blog!</h1>
            </div>}
            {currentUser && <div className="signedIn">
                <h1>Get started with your post!</h1>
                <TextField 
                fullWidth 
                multiline={true} 
                defaultValue="Enter your post here!"
                variant="outlined"/>
            </div>}
        </div>
    );
}

export default MakePost;
